import { AppBar, Button, Stack, Toolbar } from '@mui/material';
import React from 'react';
import { ReactComponent as Logo } from '../logo.svg';
import './navbar.css';

function NavBar(props) {
    var color1, color2, color3, color4;
    switch (props.page) {
        case 1:
            color1 = "primary";
            color2 = "inherit";
            color3 = "inherit";
            color4 = "inherit";
            break;
        case 2:
            color1 = "inherit";
            color2 = "primary";
            color3 = "inherit";
            color4 = "inherit";
            break;
        case 3:
            color1 = "inherit";
            color2 = "inherit";
            color3 = "primary";
            color4 = "inherit";
            break;
        case 4:
            color1 = "inherit";
            color2 = "inherit";
            color3 = "inherit";
            color4 = "primary";
            break;
        default:
            color1 = "primary";
            color2 = "inherit";
            color3 = "inherit";
            color4 = "inherit";
            break;

    }//TODO Botar arquivo svg fora daqui, e depois importar pra c치
    //TODO j치 criar o esqueleto de TODAS as paginas possiveis
    return ( //TODO: Adicionar botao de login e cadastro aparecendo em todas as telas que tem o menu. se estiver logado, mostrar botao de logout.
        <React.Fragment>
            <AppBar position='static' sx={{ top: 0, left: 0, right: 0, position: 'fixed', width: '100%' }}>
                <Toolbar sx={{ display: 'flex', flexDirection: 'row', alignItems: 'center', justifyContent: 'center' }} >

                    <a style={{ paddingTop: 10, paddingLeft: 15, top: 0, left: 0, position: 'fixed' }}>
                        <Logo />
                    </a>

                    <Stack direction='row' spacing={2}>
                        <Button color={color1} variant="contained" href='/'>Home</Button>
                        <Button color={color2} variant="contained" href='/QuemSomos'>Quem Somos</Button>
                        <Button color={color3} variant="contained" href='/ContratacaoPlanos'>Planos</Button>
                        <Button color={color4} variant="contained" href='/Contato'>Contato</Button>
                    </Stack>
                </Toolbar>
            </AppBar>
        </React.Fragment>
    );
}

export default NavBar;
